window.bookSummaryJSON = "<p>I’ve been good long enough.</p> <p>As the eldest son of Austin’s most prominent preacher, I’ve lived my life on the virtuous side. No scandals. Flawless image. Clean reputation.</p> <p>That’s the way it must be if I’m going to take his place someday.</p> <p>But everything changes when I find out my father is a VIP member of a local kink club.</p> <p>A liar. A cheater. A hypocrite.</p> <p>Now, I’m done being righteous.</p> <p>And when the club owner’s jaded girlfriend comes to me with a proposal, I can’t resist.</p> <p>Sage is nothing like the women I’ve dated before. Pink hair, tattoos, piercings. I know it’ll burn my father’s reputation to the ground when she and I are seen together.</p> <p>But our fake dating scheme isn’t enough. We need videos—dirty videos.</p> <p>The more we film these scenes, the more I like it.</p> <p>She wants me to degrade her, hurt her, violate her.</p> <p>And God help me, I want it too.</p> <p>But it’s hardly fake<i> </i>anymore, and before long, I don’t recognize the Goode man I used to be.</p>"; 
